    public partial class RankBinaryWriteTranslation : IBinaryWriteTranslator
    {
        public readonly static RankBinaryWriteTranslation Instance = new RankBinaryWriteTranslation();

        public static void WriteRecordTypes(
            IRankGetter item,
            MutagenWriter writer,
            RecordTypeConverter? recordTypeConverter)
        {
            Mutagen.Bethesda.Binary.UInt32BinaryTranslation.Instance.WriteNullable(
                writer: writer,
                item: item.Number,
                header: recordTypeConverter.ConvertToCustom(RecordTypes.RNAM));
            GenderedItemBinaryTranslation.Write(
                writer: writer,
                item: item.Title,
                maleMarker: RecordTypes.MNAM,
                femaleMarker: RecordTypes.FNAM,
                transl: (MutagenWriter subWriter, ITranslatedStringGetter? subItem) =>
                {
                    Mutagen.Bethesda.Binary.StringBinaryTranslation.Instance.WriteNullable(
                        writer: subWriter,
                        item: subItem,
                        binaryType: StringBinaryType.NullTerminate,
                        source: StringsSource.Normal);
                });
            Mutagen.Bethesda.Binary.StringBinaryTranslation.Instance.WriteNullable(
                writer: writer,
                item: item.Insignia,
                header: recordTypeConverter.ConvertToCustom(RecordTypes.INAM),
                binaryType: StringBinaryType.NullTerminate);
        }

        public void Write(
            MutagenWriter writer,
            IRankGetter item,
            RecordTypeConverter? recordTypeConverter = null)
        {
            WriteRecordTypes(
                item: item,
                writer: writer,
                recordTypeConverter: recordTypeConverter);
        }

        public void Write(
            MutagenWriter writer,
